import React from 'react';
import propsTypes from 'prop-types';

export default function NavBar(props){
    return(
        <h1>
            {props.title} -- {props.age}
        </h1>
    );
}

NavBar.propsType = {
    title:propsTypes.string,
    age:propsTypes.number
}

NavBar.defaultProps = {
    title:'vaibhav',
    age:25
}
